// src/pages/SignUp1.tsx
import React, { useState, useRef } from "react";
import Webcam from "react-webcam";
import { Box, Button, Typography } from "@mui/material";
import { useNavigate } from "react-router-dom";

const SignUp1: React.FC = () => {
    const [frontIC, setFrontIC] = useState<string | null>(null);
    const [backIC, setBackIC] = useState<string | null>(null);
    const [loading, setLoading] = useState(false);
    const webcamRef = useRef<Webcam>(null);
    const navigate = useNavigate();

    // Mobile-friendly video constraints
    const videoConstraints = {
        width: 640,
        height: 480,
        facingMode: { ideal: "environment" }, // back camera
    };

    // Capture IC image
    const captureIC = () => {
        const imageSrc = webcamRef.current?.getScreenshot();
        if (!imageSrc) {
            alert("Unable to capture image. Make sure camera permission is granted.");
            return;
        }

        if (!frontIC) {
            setFrontIC(imageSrc);
            sessionStorage.setItem("ic_front", imageSrc);
        } else if (!backIC) {
            setBackIC(imageSrc);
            sessionStorage.setItem("ic_back", imageSrc);
        }
    };

    // Send images to backend OCR
    const handleNext = async () => {
        if (!frontIC || !backIC) return alert("Please capture both front and back of IC.");

        try {
            setLoading(true);
            // NOTE: replace localhost with your PC IP if testing on mobile
            const response = await fetch("http://192.168.X.X:8000/api/ocr/extract", {
                method: "POST",
                headers: { "Content-Type": "application/json" },
                body: JSON.stringify({ front: frontIC, back: backIC }),
            });
            const result = await response.json();

            if (!result.success) {
                alert("OCR failed. Retake clearer images.");
                return;
            }

            const extracted = {
                fullName: result.fullName || "",
                icNumber: result.icNumber || "",
                address: result.address || "",
            };

            sessionStorage.setItem("signupStep2", JSON.stringify(extracted));
            navigate("/signup-step2", { state: extracted });
        } catch (err) {
            console.error(err);
            alert("Error contacting OCR server. Make sure backend is running and accessible.");
        } finally {
            setLoading(false);
        }
    };

    return (
        <Box textAlign="center" mt={3}>
            <Typography variant="h5">Scan Your IC</Typography>

            {!frontIC || !backIC ? (
                <>
                    <Webcam
                        audio={false}
                        ref={webcamRef}
                        screenshotFormat="image/jpeg"
                        videoConstraints={videoConstraints}
                        style={{
                            width: "90%",
                            maxWidth: 400,
                            height: "auto",
                            borderRadius: 10,
                            marginTop: 15,
                        }}
                    />
                    <Typography color="gray" mt={1}>
                        • Use BACK camera for best clarity <br />
                        • Ensure IC fills the frame <br />
                        • Keep device steady
                    </Typography>
                    <Button variant="contained" onClick={captureIC} sx={{ mt: 2 }}>
                        {!frontIC ? "Capture FRONT" : "Capture BACK"}
                    </Button>
                </>
            ) : (
                <>
                    <Box display="flex" justifyContent="center" gap={3} mt={2}>
                        <Box textAlign="center">
                            <Typography>Front IC</Typography>
                            <img src={frontIC} width={150} style={{ borderRadius: 8 }} />
                            <Button
                                variant="outlined"
                                sx={{ mt: 1 }}
                                onClick={() => {
                                    setFrontIC(null);
                                    sessionStorage.removeItem("ic_front");
                                }}
                            >
                                Retake
                            </Button>
                        </Box>
                        <Box textAlign="center">
                            <Typography>Back IC</Typography>
                            <img src={backIC} width={150} style={{ borderRadius: 8 }} />
                            <Button
                                variant="outlined"
                                sx={{ mt: 1 }}
                                onClick={() => {
                                    setBackIC(null);
                                    sessionStorage.removeItem("ic_back");
                                }}
                            >
                                Retake
                            </Button>
                        </Box>
                    </Box>

                    <Button
                        variant="contained"
                        sx={{ mt: 3 }}
                        onClick={handleNext}
                        disabled={loading}
                    >
                        {loading ? "Extracting..." : "Next"}
                    </Button>
                </>
            )}
        </Box>
    );
};

export default SignUp1;
